-- In a class definition a function definition without a type signature is not allowed
checkClassFunctions :: Names -> [(Name,TpScheme)] -> Errors
checkClassFunctions declVarNames ts =
    let signatures = map fst ts
    in [ NoTypeDefInClass Definition name signatures
       | name <- declVarNames
       , name `notElem` signatures
       ]
   {- ++ [ OverloadedRestrPat name
       | (name, scheme) <- xs
       , name `elem` unique
       , name `elem restrictedNames
       , isOverloaded scheme
       ] -}


-- Type signature but no function definition
-- Duplicated type signatures
-- Overloaded type scheme for a restricted pattern
checkTypeSignatures :: Names -> Names -> [(Name,TpScheme)] -> Errors
checkTypeSignatures declVarNames restrictedNames xs =
   let (unique, doubles) = uniqueAppearance (map fst xs)
   in [ Duplicated TypeSignature names
      | names <- doubles 
      ] 
   ++ [ NoFunDef TypeSignature name declVarNames
      | name <- unique
      , name `notElem` declVarNames
      ]
   ++ [ OverloadedRestrPat name
      | (name, scheme) <- xs
      , name `elem` unique 
      , name `elem` restrictedNames     
      , isOverloaded scheme
      ] 


isSimplePattern :: Pattern -> Bool
isSimplePattern pattern =
   case pattern of
      Pattern_Variable _ _ -> True
      Pattern_Parenthesized  _ p -> isSimplePattern p
      _ -> False

--This function inspects whether a type is legal as type  for declaring an instance on
validInstanceType :: Type -> Bool
validInstanceType (Type_Constructor _ _) = True  -- A simple type is fine
validInstanceType (Type_Parenthesized _ t) = validInstanceType t -- Just look inside
validInstanceType (Type_Application _ _ ty tys) = (validApplyType ty tys) && (and $ map validInnerInstanceType tys) -- Some complicated stuff
validInstanceType _                      = False -- We don't like quantified and unbound types etc...

validInnerInstanceType :: Type -> Bool
validInnerInstanceType (Type_Parenthesized _ t) = validInnerInstanceType t
validInnerInstanceType (Type_Variable _ _) = True
validInnerInstanceType _                   = False

validApplyType :: Type -> Types -> Bool
validApplyType (Type_Constructor _ n) ts = validInstanceConstrName n ts
validApplyType _                      _  =  False

validInstanceConstrName :: Name -> Types -> Bool
validInstanceConstrName (Name_Special _ _ s) ts = s == "(" ++ replicate (length ts - 1) ',' ++ ")" || s == "[]"
    --We just want to know if it was a tuple
validInstanceConstrName (Name_Identifier _ _ _) _ = True
validInstanceConstrName _ _ = False

-- All type variables in an instance declaration have to be unique

nonUniqueTypeVars :: Names -> Names
nonUniqueTypeVars (x:xs) | elem x xs = x : nonUniqueTypeVars xs
                         | otherwise = nonUniqueTypeVars xs
nonUniqueTypeVars []     = []

classExists :: Name -> ClassMemberEnvironment -> (Maybe ClassDef)
classExists n cm = case (M.lookup n cm) of
                    (Just m) -> Just (n, m)
                    Nothing  -> Nothing

instanceMembers :: MaybeDeclarations -> ClassDef -> Errors
instanceMembers MaybeDeclarations_Nothing _ = []
instanceMembers (MaybeDeclarations_Just decls) d = instanceMembers' decls d
  -- where n = concatMap nameOfDeclaration decls

instanceMembers' :: Declarations -> ClassDef -> Errors
instanceMembers' (d:ds) c@(n, members) = let fn = head $ nameOfDeclaration d
                                             cm = map (\(x, _) -> x) members
                                          in
                                             case elem fn cm of
                                              True -> instanceMembers' ds c
                                              False -> UndefinedFunctionForClass n fn cm : instanceMembers' ds c 
instanceMembers' []     _       = []

--Check all instance declarations, check if their superclass relations hold, return those predicates that fail to check.
checkClassEnvironment :: OrderedTypeSynonyms -> ClassEnvironment -> [(Range, Instance)] -> [(Range, Predicate, Predicates)]
checkClassEnvironment env cEnv allInstances = map (\(r, (i, ctxt)) -> let
                                                                     proves = bySuperclass cEnv i
                                                                     classEnv = foldr insertInst cEnv allInstances
                                                                     in (r, i, filter  (\p -> not $ (entail env classEnv ctxt p)) proves)) allInstances

insertInst :: (t, (Predicate, Predicates)) -> ClassEnvironment -> ClassEnvironment                                                                     
insertInst (_, inst@((Predicate n _), _)) env = insertInstance n inst env

makeClassEnvironmentErrors :: [(Range, Predicate, Predicates)] -> Errors
makeClassEnvironmentErrors ((r, c, pr):insts) | pr == []  = makeClassEnvironmentErrors insts
                                              | otherwise = foldr (\p -> (:)(MissingSuperClass r c p)) (makeClassEnvironmentErrors insts) pr
makeClassEnvironmentErrors []                             = []             


overlappingInstances :: ClassEnvironment -> Errors
overlappingInstances = M.foldWithKey (\k (_, i) b -> (overlappingInstances' k i) ++ b) []
   where
    overlappingInstances' :: String -> Instances -> Errors
    overlappingInstances' name insts = [OverlappingInstance name ty | 
                            ty <- map head $ filter (\l -> length l > 1) $ group . sort $ map ((\(Predicate _ ty) -> fst $ leftSpine ty) . fst) insts]

noTypeSynonymsInInstance :: OrderedTypeSynonyms -> [(Range, Instance)] -> Errors
noTypeSynonymsInInstance typeSyn ((r, (p, _)):insts)  = if (typeSynonymInPredicate typeSyn p)
                                                         then (TypeSynonymInInstance r p) : (noTypeSynonymsInInstance typeSyn insts)
                                                         else noTypeSynonymsInInstance typeSyn insts
noTypeSynonymsInInstance _      []                    = []  

typeSynonymInPredicate :: OrderedTypeSynonyms -> Predicate -> Bool
typeSynonymInPredicate typeSyn (Predicate _ ty) = case (expandToplevelTC typeSyn ty) of
                                                    Nothing -> False
                                                    _       -> True
deleteNoFunDefErrors :: Errors -> Errors 
deleteNoFunDefErrors errs = filter p errs where
    p (NoFunDef TypeSignature _ _) = False
    p _              = True


findSimilarFunctionBindings :: [(Name, TpScheme)] -> [(Name,Name)] -> [Warning]
findSimilarFunctionBindings environment candidates = 
   let namesWithTypeDef = map fst environment
   in [ uncurry SimilarFunctionBindings pair
      | (n1,n2) <- candidates
      , let bool1 = n1 `elem` namesWithTypeDef
            bool2 = n2 `elem` namesWithTypeDef
            pair  = if bool1 then (n2,n1) else (n1,n2)
      , bool1 `xor` bool2
      ]

xor :: Bool -> Bool -> Bool
xor b1 b2 = not (b1 == b2)


simplifyContext :: OrderedTypeSynonyms -> Range -> [(Int, Name)] -> TpScheme -> Warnings
simplifyContext synonyms range intMap typescheme = 
   let predicates = qualifiers (unquantify typescheme)
       reduced    = f predicates []
          where f [] as = reverse as -- reverse to original order
                f (p:ps) as 
                   | entail synonyms standardClasses (ps++as) p = f ps as
                   | otherwise = f ps (p:as)
       sub = listToSubstitution [ (i, TCon (show n)) | (i, n) <- intMap ]
   in if length reduced == length predicates 
        then []
        else [ ReduceContext range (sub |-> predicates) (sub |-> reduced) ]



noInstanceOrDefault :: Maybe ClassDef -> MaybeDeclarations -> Names
noInstanceOrDefault Nothing             _                              = []
noInstanceOrDefault (Just (_, members)) MaybeDeclarations_Nothing      = [ n | (n, d) <- members, not d ]
noInstanceOrDefault (Just (_, members)) (MaybeDeclarations_Just decls) = [ n | (n, d) <- members, not d
                                                                             , notElem n (map (head . nameOfDeclaration) decls) ]



checkType :: M.Map Name Int -> Names -> Type -> [Error]
checkType theTypeConstructors namesInScope t =
    let (f, xs) = walkSpine t
        xsErrors = concatMap (checkType theTypeConstructors namesInScope) xs
    in
        xsErrors
        ++
        case f of
            Type_Constructor r c ->
                checkKind c theTypeConstructors (length xs) namesInScope
                ++ [ TupleTooBig r
                   | let nameAsString = show c
                   , isTupleConstructor nameAsString
                   , length nameAsString - 1 > 10
                   ]
            Type_Variable _ v ->
                if length xs /= 0 then
                    [ TypeVarApplication v ]
                else
                    []
            _ ->
                internalError "StaticAnalysis" "checkType" "unexpected type"

walkSpine :: Type -> (Type, [Type])
walkSpine t =
    case t of
        Type_Variable _ _ -> (t, [])
        Type_Constructor _ _ -> (t, [])
        Type_Application _ _ f xs ->
            let (t', ys) = walkSpine f
            in (t', ys ++ xs)
        Type_Parenthesized _ t' -> walkSpine t'
        Type_Qualified _ _ t' -> walkSpine t'
        _ -> internalError "StaticAnalysis" "walkSpine" "unexpected type"

checkKind :: Name -> M.Map Name Int -> Int -> Names -> [Error]
checkKind tycon@(Name_Special _ _ ('(':commas)) _ useArity _ = -- !!!Name
    if expected == useArity then
        []
    else
        [ ArityMismatch TypeConstructor tycon expected useArity]
    where
        expected =
            case length (takeWhile (== ',') commas) of
                 0 -> 0  -- ()
                 n -> n + 1 -- (,) (,,) ...

checkKind tycon theTypeConstructors useArity namesInScope =
    case M.lookup tycon theTypeConstructors of
        Nothing ->
            let hint = [ "Constructor "++show (show tycon)++" cannot be used in a type"
                       | tycon `elem` namesInScope
                       ]
            in [ Undefined TypeConstructor tycon (M.keys theTypeConstructors) hint ]
        Just defArity ->
            if useArity /= defArity then
                [ ArityMismatch TypeConstructor tycon defArity useArity ]
            else
                [ ]

                  
type ScopeInfo = ( [Names]          -- duplicated variables
                 , [Name]           -- unused variables
                 , [(Name, Name)]   -- shadowed variables
                 )

changeOfScope :: Names -> Names -> Names -> (Names, Names, ScopeInfo)
changeOfScope names unboundNames namesInScope = 
   let (uniqueNames, duplicatedNames) = uniqueAppearance names
       unusedNames   = uniqueNames \\ unboundNames
       shadowedNames = let f n = [ (n, n') | n' <- namesInScope, n == n' ]
                       in concatMap f uniqueNames
   in ( uniqueNames ++ map head duplicatedNames ++ (namesInScope \\ names)
      , unboundNames \\ names
      , (duplicatedNames, unusedNames, shadowedNames)
      )
      
uniqueAppearance :: Ord a => [a] -> ([a],[[a]])
uniqueAppearance = Prelude.foldr myInsert ([],[]) . group . sort
   where myInsert [x] (as,bs) = (x:as,bs)
         myInsert xs  (as,bs) = (as,xs:bs)
       
nextUnique :: Num a => a -> (a, a)         
nextUnique n = (n+1, n)


uniqueKeys :: Ord key => [(key,a)] -> ([(key,a)],[[key]])
uniqueKeys = let comp (x,_) (y,_) = compare x y
                 eq   (x,_) (y,_) = x == y
                 predicate xs = length xs == 1 
             in (\(xs, ys) -> (map head xs, map (map fst) ys)) 
              . partition predicate 
              . groupBy eq 
              . sortBy comp




-- The following haskell code is used for building a temporary dictionairy in order to complete static checks
type ClassDef = (Name, ClassMembers)
type ClassMembers = [(Name, Bool)]

--In declarations we find both type signatures and function declarations
filterType :: Declarations -> (Declarations, Declarations) -> (Declarations, Declarations)
filterType (d@(Declaration_TypeSignature _ _ _):ds) (t, dec) = filterType ds (d:t, dec)
filterType (d:ds) (t, dec)                                   = filterType ds (t, d:dec)
filterType []     res                                        = res

--A type can be declared for multiple function names
createClassDef1 :: Declaration -> ClassMembers
createClassDef1 (Declaration_TypeSignature _ names _) = [(n, False) | n <- names]
createClassDef1 _                                      = error "Error createClassDef1, filtering failed..."

--A function declaration should be associated with a type in the class definition
createClassDef2 :: Declarations -> ClassMembers -> ClassMembers
createClassDef2 (d:ds) m = createClassDef2 ds $ createClassDef2' (nameOfDeclaration d) d m
createClassDef2 []     m = m

createClassDef2' :: Eq t1 => [t1] -> t -> [(t1, Bool)] -> [(t1, Bool)]
createClassDef2' (n:ns) d m = createClassDef2' ns d $ createClassDef2'' n d m
createClassDef2' []     _ m = m


createClassDef2'' :: Eq t1 => t1 -> t -> [(t1, Bool)] -> [(t1, Bool)]
createClassDef2'' n d (m@(n2, _):ms) | n == n2   = (n2, True):ms
                                     | otherwise = m:(createClassDef2'' n d ms)
createClassDef2'' _ _ []                             = [] -- Should not happen but if it happens the error is reported by another check

createClassDef :: Name -> MaybeDeclarations -> ClassMemberEnvironment
createClassDef n MaybeDeclarations_Nothing      = M.singleton n []
createClassDef n (MaybeDeclarations_Just decls) = M.singleton n (createClassDef2 fdecl $ concatMap createClassDef1 types)
               where (types, fdecl) = filterType decls ([], [])




getClassName :: SimpleType -> String
getClassName (SimpleType_SimpleType _ n _) = getNameName n

getSuperClasses ::  ContextItems -> [String]
getSuperClasses = map (\(ContextItem_ContextItem _ n _) -> getNameName n)




createInstance :: Range -> Name -> Type -> ContextItems -> (Range, Instance)
createInstance r n ty ctx = (r, (makePredicate n ty , map (\(ContextItem_ContextItem _ n2 tys) -> makePredicate n2 (head tys)) ctx))
   where nameMap = makeNameMap (namesInTypes $ ty : (map (\(ContextItem_ContextItem _ _ tys) -> head tys) ctx))
         makePredicate :: Name -> Type -> Predicate
         makePredicate nm typ = Predicate (getNameName nm) (makeTpFromType nameMap typ)



-- filter undefined errors that are caused by the removal of a duplicate definition
filterRemovedNames :: [(Name,Entity)] -> Error -> Bool
filterRemovedNames list err = 
   case err of  
      Undefined entity name _ _ -> (name,entity) `notElem` list
      _                         -> True
      
filterDerivedNames :: [Range] -> Error -> Bool
filterDerivedNames ranges err = 
   case err of
      Duplicated Definition names -> any (`notElem` ranges) (map getNameRange names) 
      _                           -> True
